import styled from "styled-components";

export const Title = styled.h1`
  font-size: 50px;
  color: ${({ theme }) => theme.colors.primary};
`;
export const Background = styled.div`
  background-color: ${({ theme }) => theme.colors.background};
  left: 0;
  bottom: 0;
`;
